import React, { useContext } from 'react';
import PassportContext from '../../contexts/passportContext';
import { Link, NavLink } from 'react-router-dom';

const Navigation = () => {

    const { cityData } = useContext(PassportContext);

    return (
        <div className='navigation'>
            <div className='logo'>Restaurant Passport</div>
            <div className='nav-links'>
                <NavLink to='/passport'>
                    My Passport <span>{cityData.length}</span>
                </NavLink>
                {localStorage.getItem('token') ? <Link className='btn btn-outline-primary'>Log Out</Link> : <Link className='btn btn-outline-primary' to='/registration'>Try it FREE</Link>}
            </div>
        </div >
    );
};

export default Navigation;
